script: |
  super -f text -I q5537.spq | sort > q5537.out

inputs:
  - name: q5537.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE + col0 - 34 / - ( col0 ) * + - 92 NOT BETWEEN 5 + col2 AND - - col0 + 53;
  - name: tab0

outputs:
  - name: q5537.out
    data: |
      15	81	47
      97	1	99
